    cluster: clusterName,
    service: service,
    taskDefinition: taskDefArn,
    forceNewDeployment: forceNewDeployment,
    enableECSManagedTags: enableECSManagedTags,
    propagateTags: propagateTags,
    volumeConfigurations: volumeConfigurations
